(1, '지메일 가자333', 'RDCOMMON', 'SELECT \r\n	JSON_OBJECT(\r\n		\'USR_ID\',a.USR_ID\r\n		, \'USR_NM\', a.USR_NM\r\n		, \'LOGIN_LIST\'\r\n			, JSON_ARRAYAGG(\r\n				JSON_OBJECT(\"IP\", b.REMOTE_ADDR, \"LOGIN_DT\", b.ADD_DT, \"USER_AGENT\", b.USER_AGENT) ORDER BY b.ADD_DT desc limit 5\r\n			)\r\n		) as JSON_DATA\r\nFROM CMN_USR a join CMN_LOG_LOGIN b ON a.USR_SEQ = b.USR_SEQ\r\nwhere a.USR_SEQ=#{USR_SEQ}', 'i', 'c', 'd', '{{USR_NM}}님, 로그인 이력 안내', '<p><strong>{{USR_NM}}</strong>고객님의 로그인 이력은 아래와 같습니다.</p>\r\n\r\n<table style=\"width: 100%; height: 48px;\">\r\n    <tbody>\r\n        <tr style=\"text-align: center;\">\r\n            <td style=\"background-color: rgb(164, 194, 244); width: 19.1886%; text-align: center;\">접속일자</td>\r\n            <td style=\"background-color: rgb(164, 194, 244); width: 32.1229%; text-align: center;\">접속IP</td>\r\n            <td style=\"background-color: rgb(164, 194, 244); width: 48.324%; text-align: center;\">브라우져</td>\r\n        </tr>\r\n        <!--{{#LOGIN_LIST}}-->\r\n        <tr>\r\n            <td style=\"width: 19.1886%;\">{{LOGIN_DT}}</td>\r\n            <td style=\"width: 32.1229%;\">{{IP}}</td>\r\n            <td style=\"width: 48.324%;\">{{USER_AGENT}}</td>\r\n        </tr>\r\n        <!--{{/LOGIN_LIST}}-->\r\n    </tbody>\r\n</table>', '20210401215035', 0, '20210407214756', 0),
(2, '1', '2', 'aaa', '', '3', '4', '5', '<p>bbb</p>', '20210401215137', 0, '20210401215148', 0);

